    elevation: "24",
  },
}));
function Login() {
  const classes = useStyles();
  return (

      <Paper elevation={24} style = {{
        maxWidth: "auto",
        marginTop: "100px",
        background :
          "radial-gradient(circle, rgba(6,103,144,1) 21%, rgba(174,45,181,1) 98%)",
        marginLeft: "auto",
        marginRight: "auto",
        display: "flex"
      }} >

            <form>
              <TextField
                id="filled-textarea"
                label=""
                placeholder="Enter your email"
                multiline
                fullWidth={true}
                variant="filled"
              />
              <TextField
                id="filled-textarea"
                label=""
                placeholder="Enter your password"
                multiline
                fullWidth={true}
                variant="filled"
              />
              <Button type="submit" variant="contained" color="primary">
                Post
              </Button>
            </form>

      </Paper>

  );
}

export default Login;
